import React from "react";
import Table from 'react-bootstrap/Table';

const factors = () => {
    return (
        <div>
            <Table bordered>
                <thead>
                    <tr>
                        <th>Flight Name</th>
                        <th>Departure Location</th>
                        <th>Wind Speed</th>
                        <th>Holidays</th>
                    </tr>
                </thead>
            </Table>
        </div>
    );
}
export default factors;
